import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Helmet } from "react-helmet";
import Home from "./Components/Home";
import Career from "./Components/Career";
import Contact from "./Components/Contact";
import About from "./Components/About";
import GoldProduct from "./Components/GoldProduct";
import SliverProduct from "./Components/SliverProduct";
import SliverProductList from "./Components/SliverProductsList";
import GoldProductList from "./Components/GoldProductsList";
import ScrollToTop from "./scrollToTop";

function App() {
  return (
    <>
      <ScrollToTop />

      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Home />
              </>
            }
          />
          <Route
            path="/gold"
            element={
              <>
                <GoldProduct />
              </>
            }
          />
          <Route
            path="/sliver"
            element={
              <>
                <SliverProduct />
              </>
            }
          />
          <Route
            path="/sliverproducts"
            element={
              <>
                <SliverProductList />
              </>
            }
          />
          <Route
            path="/goldproducts"
            element={
              <>
                <GoldProductList />
              </>
            }
          />
          <Route
            path="/about"
            element={
              <>
                <About />
              </>
            }
          />
          <Route
            path="/contact"
            element={
              <>
                <Contact />
              </>
            }
          />
          <Route
            path="/career"
            element={
              <>
                <Career />
              </>
            }
          />
        </Routes>
      </BrowserRouter>

      <Helmet>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/main.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/jquery-ui.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/jquery.countdown.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/sal.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/jquery.magnific-popup.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/imagesloaded.pkgd.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/isotope.pkgd.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/counterup.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/waypoints.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/popper.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/bootstrap.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/slick.min.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/js.cookie.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/jquery.js"></script>
        <script src="https://new.axilthemes.com/demo/template/etrade/assets/js/vendor/modernizr.min.js"></script>
      </Helmet>
    </>
  );
}

export default App;
